# LeetCode Working Solution.    
def fourSum(nums, target):
    ln = len(nums)
    if ln <4:
        return
    res  = set()
    nums  = sorted(nums)
    for i in range (0, ln -3):
        for j in range (i+1, ln -2):
            start  = j+1
            end = ln-1
            while (start <end):
                if nums[i] + nums[j] + nums[start] + nums[end] > target:
                    end  = end -1
                elif nums[i] + nums [j] + nums[start] + nums[end] < target:
                    start  = start+1
                else:
                    res.add(tuple(sorted([nums[i], nums[j],nums[start], nums[end]])))
                    start = start +1
                    if nums[start] == nums[end]:
                        break
    return res              
                
def fourSumNew(nums, target):
        
    ln = len(nums)
    if ln <3:
        return
    res  = set()
    nums  = sorted(nums)
    
    d = dict()
     
    for i in range (0,ln):
        for j in range (i+1, ln):
            sm = nums[i] + nums[j]
            if sm in d.keys():
                d[sm] += [(i,j)]
            else:
                d[sm] = [(i,j)]
    
    for key,val in d.items():
            newTarget  = target - key
            start = 0
            end = ln-1
            for num in val:
                num1 = nums[num[0]]
                num2 =  nums[num[1]]
                index1 = num[0]
                index2 = num[1]
                while (start <end):
                    if nums[start] + nums[end] > newTarget:
                        end  = end -1
                    elif nums[start] + nums[end] < newTarget:
                        start  = start+1
                    else:
                        if index1 != start and index2 != end and index2 != start and index1 != end: 
                            res.add(tuple(sorted([num1, num2, nums[start], nums[end]])))
                        start = start +1
                       
    return res              
    
